import{_ as o,c as i,o as a,ag as t}from"./chunks/framework.Bksy39di.js";const k=JSON.parse('{"title":"Koin Embedded","description":"","frontmatter":{"title":"Koin Embedded","custom_edit_url":null},"headers":[],"relativePath":"ja/koin/support/embedded.md","filePath":"ja/koin/support/embedded.md","lastUpdated":1750001831000}'),d={name:"ja/koin/support/embedded.md"};function n(r,e,s,l,p,c){return a(),i("div",null,e[0]||(e[0]=[t('<h1 id="koin-embedded" tabindex="-1">Koin Embedded <a class="header-anchor" href="#koin-embedded" aria-label="Permalink to &quot;Koin Embedded&quot;">​</a></h1><p>Koin Embeddedは、Android/Kotlin SDKおよびライブラリ開発者をターゲットとした、新しいKoinプロジェクトです。</p><p>このプロジェクトは、異なるパッケージ名でKoinプロジェクトを再ビルドおよびパッケージ化するのに役立つスクリプトを提案します。その目的は、SDKおよびライブラリ開発において、埋め込みKoinバージョンと、衝突する可能性のある別のKoinバージョンを使用する利用側のアプリケーションとの間の衝突を避けることです。</p><p>フィードバックやヘルプについては、<a href="mailto:koin@kotzilla.io" target="_blank" rel="noreferrer">Koinチーム</a>にお問い合わせください。</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>この取り組みは現在ベータ版であり、フィードバックを募集しています</p></div><h2 id="埋め込みバージョン-ベータ版" tabindex="-1">埋め込みバージョン (ベータ版) <a class="header-anchor" href="#埋め込みバージョン-ベータ版" aria-label="Permalink to &quot;埋め込みバージョン (ベータ版)&quot;">​</a></h2><p>こちらはKoin埋め込みバージョンの例です: <a href="https://repository.kotzilla.io/#browse/browse:Koin-Embedded" target="_blank" rel="noreferrer">Kotzilla Repository</a></p><ul><li>利用可能なパッケージ: <code>embedded-koin-core</code>、<code>embedded-koin-android</code></li><li><code>org.koin.*</code>から<code>embedded.koin.*</code>へのリロケーション</li></ul><p>Gradle設定でこのMavenリポジトリを設定してください:</p><div class="language-kotlin vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kotlin</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">maven</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> { </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;https://repository.kotzilla.io/repository/kotzilla-platform/&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> }</span></span></code></pre></div><h2 id="リロケーションスクリプト-ベータ版" tabindex="-1">リロケーションスクリプト (ベータ版) <a class="header-anchor" href="#リロケーションスクリプト-ベータ版" aria-label="Permalink to &quot;リロケーションスクリプト (ベータ版)&quot;">​</a></h2><p>こちらは、指定されたパッケージ名でKoinを再ビルドし、それを埋め込み、Koinフレームワークの通常の使用との衝突を避けるのに役立つスクリプトです。</p><p>詳細については、Koinの<a href="https://github.com/InsertKoinIO/koin-embedded?tab=readme-ov-file#koin-relocation-scripts" target="_blank" rel="noreferrer">リロケーションスクリプト</a>プロジェクトを参照してください。</p>',13)]))}const m=o(d,[["render",n]]);export{k as __pageData,m as default};
